script: |
  super -f text -I q6532.spq | sort > q6532.out

inputs:
  - name: q6532.spq
    data: |
      SELECT DISTINCT + col2 + + col0 + - ( 8 ) * - 92 - + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - 98 >= + - col0 / + col2 + + col2 );
  - name: tab0

outputs:
  - name: q6532.out
    data: |
      751
      823
      833
